import React, { useEffect } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  let data = ''
  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      console.log(res.body)
    })

  });
  return (
  <div>
    Welcome to Next.js!
    <div>
      {data}
    </div>
  </div>
  )
}

export default HomePage
